import React from "react";
import img1 from "../../../slick/pexels-delcho-dichev-114220-517884.jpg";
import img2 from "../../../slick/pexels-eberhardgross-2098428.jpg";
import img3 from "../../../slick/pexels-felixmittermeier-957085.jpg";
import img4 from "../../../slick/pexels-jeff-nissen-326939-920689.jpg";
import img5 from "../../../slick/pexels-pixabay-41951.jpg";
import img6 from "../../../slick/pexels-delcho-dichev-114220-517884.jpg";
import img7 from "../../../slick/pexels-felixmittermeier-957085.jpg";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Service = () => {
  let new_array = [img1, img2, img3, img4, img5, img6, img7];
  console.log(new_array);
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 2,
    responsive: [
      {
        breakpoint: 1200,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 3,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],
  };
  return (
    <div className="service">
      <h1 className="headservice">Service</h1>
      <Slider {...settings}>
        <div>
          <h3>1</h3>
        </div>
        <div>
          <h3>2</h3>
        </div>
        <div>
          <h3>3</h3>
        </div>
        <div>
          <h3>4</h3>
        </div>
        <div>
          <h3>5</h3>
        </div>
        <div>
          <h3>6</h3>
        </div>
      </Slider>
    </div>
  );
};

export default Service;
